import React from 'react';
import { NavLink} from 'react-router-dom';
import "./Navbar.css"

function Navbar() {
  return (
    <div className='navbarr'>
        <ul>
            <li><NavLink className="NavLink" to="/" ><img src='' alt="" /></NavLink>   </li>
        </ul>
        <ul>
            <li><NavLink to="/" activeClassName="Activee" className="NavLink" >Home</NavLink></li>\
        </ul>
        <ul>
            <li>  <NavLink to="/login"  > <button className='button'>Login/Register</button> </NavLink>   </li>
        </ul>
    </div>
  );
}

export default Navbar;
